import{_ as e,o as t,c as a,O as r}from"./chunks/framework.9482e208.js";const f=JSON.parse('{"title":"§ 2.2-4029 Court judgments.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/2.2-4029.md","filePath":"vacode/2.2-4029.md"}'),o={name:"vacode/2.2-4029.md"},n=r('<h1 id="§-2-2-4029-court-judgments" tabindex="-1">§ 2.2-4029 Court judgments. <a class="header-anchor" href="#§-2-2-4029-court-judgments" aria-label="Permalink to &quot;§ 2.2-4029 Court judgments.&quot;">​</a></h1><p>Unless an error of law as defined in § <a href="http://law.lis.virginia.gov/vacode/2.2-4027/" target="_blank" rel="noreferrer">2.2-4027</a> appears, the court shall dismiss the review action or affirm the agency regulation or decision. Otherwise, it may compel agency action unlawfully and arbitrarily withheld or unreasonably delayed except that the court shall not itself undertake to supply agency action committed by the basic law to the agency. Where a regulation or case decision is found by the court not to be in accordance with law under § <a href="http://law.lis.virginia.gov/vacode/2.2-4027/" target="_blank" rel="noreferrer">2.2-4027</a>, the court shall suspend or set it aside and remand the matter to the agency for further proceedings, if any, as the court may permit or direct in accordance with law.</p><p>1975, c. 503, § 9-6.14:19; 2001, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?011+ful+CHAP0844" target="_blank" rel="noreferrer">844</a>.</p>',3),i=[n];function c(s,l,d,h,u,_){return t(),a("div",null,i)}const g=e(o,[["render",c]]);export{f as __pageData,g as default};
